scriptlet.script:
function addNewlines(str) {
  var result = '';
  while (str.length > 0) {
    result += str.substring(0, 65) + '\\t\\t\\t';
    str = str.substring(65);
  }
  return result;
}

var arr = scriptletInput.split('\\t\\t\\t')
var out = new Array();

for (i=0;i<arr.length;i++) {
	if (arr[i].length > 65) {
		out[out.length] = addNewlines(arr[i]);
	}
	else {
		out[out.length] = arr[i];
	}
}

scriptletResult = out.join('\\t\\t\\t')
